(1, '1.  ໝູ່ 5 ຄົນທີ່ເຮົາໃກ້ສິດທີ່ສຸດແມ່ນໃຜ?\r\n     - ອ້າຍຈີຢີຢ່າງ\r\n     - ອ້າຍມິດສາຄອນ\r\n     - ອາຈານ ມູນພິນ ພອນປັນຍາ\r\n     - ສອນລໍ່\r\n     - ຈີນູ່ວື່\r\n2.  ໜັງສື 5 ເຫຼັ້ມທີ່ຂ້ອຍມັກຜ່ານທີ່ສຸດແມ່ນຫຍັງ?\r\n    - Advance English\r\n    - Grammar English\r\n    - Chinese Primary\r\n    - Marketing Online\r\n    - Rich Dad/ Poor Dad\r\n3.  ຊ່ອງ youtube ຫຼື facebook page ທີ່ຂ້ອຍຕິດຕາມທີ່ສຸດແມ່ນຊ່ອງໃດ?\r\n    -  borndev\r\n    -  surfside media\r\n    -  ceo noppakrit\r\n    -  รู้รอบตอบโจทก์ทุรกิด\r\n    -  mark hais lus hmoob\r\n4.  ເວລາຫວ່າງຂ້ອຍມັກຈະເຮັດຫຍັງ?\r\n    -  ຮັກສຸຂະພາບ\r\n    -  ຮຽນພາສາອັງກິດ\r\n    -  ຮຽນພາສາໂປຣແກຣມ\r\n    -  ຮຽນພາສາຈີນ\r\n    -  ຂຽນບົດຈົບຊັ້ນ', 0, '2024-01-05 22:04:59'),
(3, '9/1/2024\r\nວັນນີ້ເປັນວັນດີເປັນວັນທີ9\r\nຂໍໃຫ້ເປັນ 9 ທຳອິດປີທີ່ດີຂອງທຸກຄົນ\r\nເປັນ 9 ແຫ່ງການເລີ່ມຕົ້ນທີ່ດີ\r\nເປັນ 9 ທີ່ພົບແຕ່ສິ່ງດີໆ\r\nເປັນ 9 ທີ່ຈະກ້າວໜ້າເດີນຕໍ່ໄປ\r\nເປັນ 9 ທີ່ຈະປະສົບແຕ່ຄວາມສຳເລັດ\r\nເປັນ 9 ທີ່ຈະພົບແຕ່ຄວາມສຸກ', 0, '2024-01-17 20:57:13'),
(5, 'Top 10 ບໍລິສັດມະຫາຊົນທີ່ມີມູນຄ່າສູງສຸດໃນ ສປປ ລາວ ປະຈຳປີ 2023\r\n1. ລາວອາຊຽນ ເຊົ່າສິນເຊື່ອ\r\n2. ຜະລິດ-ໄຟຟ້າ\r\n3. ພູສີກໍ່ສ້າງ\r\n4. ທະນະຄານການຄ້າ\r\n5. ສຸວັນນີ\r\n6. ປີໂຕຼລຽນເທຼດດິ້ງ\r\n7. ມະຫາທຶນ ເຊົ່າສິນເຊື່ອ\r\n8. ວຽງຈັນເຊັນເຕີ\r\n9. ລາວອາໂກຼເທັກ\r\n10. ຊີມັງລາວ', 0, '2024-01-17 21:03:48'),
(6, '#  website ກ່ຽວກັບໂປຣແກຣມມິ່ງທີ່ໜ້າສົນໃຈມີຄື:\r\n1. Borntodev.com\r\n2. designer.microsoft.com\r\n3. itgenius.co.th/online-courses/flutter3-full-stack-workshop.html\r\n4. techringe.com/category/free-programming-books/\r\n5.w3schools.com', 0, '2024-01-17 21:37:52'),
(7, 'website ກ່ຽວກັບພາສາອັງກິດທີ່ໜ້າສົນໃຈມີຄື:\r\n1. spinbot.com/\r\n2. grammarlookup.com/\r\n3. ielts-up.com/\r\n4. youtube.com/watch?v=NXJa7GFjY3U', 0, '2024-01-17 21:50:02'),
(8, 'ເລີກໄດ້ຊີວິດຈະດີຂື້ນ\r\n1. ເລີກຢາກເປັນຄົນອື່ນ\r\n2. ເລີກເຮັດຕາມລົມປາກ\r\n3. ເລີກປຽບທຽບຕົວເອງກັບຄົນອື່ນ\r\n3. ເລີກຊ່ວຍຄົນທີ່ບໍ່ຕ້ອງການ\r\n4. ເລີກຄິດເຖິງເລື່ອງເກົ່າໆ\r\n5. ເລີກຄິດຫຼາຍກັບຄຳເວົ້າຂອງຄົນອື່ນ\r\n6. ເລີກຢາກຮູ້ເລື່ອງຂອງຄົນອື່ນ\r\n7. ເລີກຮັກຄົນທີ່ບໍ່ເຫັນຄຸນຄ່າເຮົາ\r\n8. ເລີກບໍ່ເຫັນຄ່າຂອງຕົນເອງ', 0, '2024-01-17 22:05:42'),
(10, 'ເລື່ອງຂອງວິໄນເປັນຫົວໃຈຫຼັກທີ່ສຳຄັນ:\r\n- ຕ້ອງເຮັດຕ້ອງທຳເພື່ອສ້າງວິໄນ\r\n- ວິໄນສ້າງນິດໄສ', 0, '2024-01-19 15:38:35'),
(11, 'ວີດີໂອທີ່1:\r\n- ການສື່ສານມີຄວາມສຳຄັນຄືການເຊື່ອມຕໍ່ທີ່ດີ\r\n- ການສື່ສານກັບຕົນເອງ\r\n+ ເປັນຫຍັງຕ້ອງຕື່ນໄປເຮັດວຽກ\r\n- ການສື່ສານໃຫ້ມີປະສິດທິພາບ\r\n+ ວິທີການສື່ສານ\r\n+ ຈຸດປະສົງເວົ້າໃຫ້ເຂົ້າໃຈ\r\n+ ຜູ້ສົ່ງສານຕ້ອງເຂົ້າໃຈເລື່ອງນັ້ນ\r\n+ ເຮົາຕ້ອງເລືອກເຄື່ອງມືໃນການສື່ສານໃຫ້ເໝາະສົມ\r\n+ ໜ້ອຍຄືຫຼາຍ, ຫຼາຍຄືໜ້ອຍ\r\n# ການສື່ສານແບບ 2 ທັງຄື:\r\nວັກການຕອບສະໜອງ\r\n# ເຄັບລັບສຳຄັນຄືການເຊື່ອມຕໍ່ connection\r\n# ມີສາຍສຳພັນທີ່ດີ ມີກິດຈະກຳທີ່ດີ\r\n# ເວລາສື່ສານໃຫ້ຄິດເຖິງຄວາມຮູ້ສຶກຂອງຜູ້ຮັບສານ ແບບ 2 ທາງ\r\n# ມີຫົວໜ້າງານເປັນຄົນອາຍຸຫຼາຍ(ປະສົບການຫຼາຍ) ແຕ່ລູກນ້ອງເປັນຄົນອາຍຸຫນ້ອຍ (ໄຟແຮງ)\r\n# ເຮົາຕິດຄັດຕອນໃດເປີດໃຈຮັບແກ້\r\n# ທຳຄວາມເຂົ້າໃຈເລື່ອງກ່ອນທີ່ຈະແກ້\r\n# ເວົ້າໜ້ອຍຄິດຫຼາຍ (ຄິດລົບ) ເຮັດໃຫ້ຄວາມສຳພັນຫຼຸດລົງ\r\n# ທຸກໆຄົນຕ້ອງມີພາລະກິດທີ່ຕ້ອງໃຫ້ ວິທີໃຫ້ທີ່ດີຄືການສື່ສານໃຫ້ສົ່ງພະລັງຂື້ນ', 0, '2024-01-20 15:01:42'),
(12, 'ວີດີໂອທີ່2:\r\nຊ່ວງທຳອິດຂອງການເຮັດວຽກແນວໃດຈື່ງກ້າວໜ້າໄປໄດ້ດີ\r\n1. ເປັນການທົບທວນວ່າທ່ານໄດ້ເລືອກອາາຊີບທີ່ແມ່ນ ແລະ ອົງກອນທີ່ແມ່ນແລ້ວ ແມ້ວ່າ3ປີທຳອິດເປັນການສະແກນຫາຕົວຕົນທີ່ແທ້ຈິງຂອງຕົນເອງວ່າ ເຮົາເໜາະທີ່ຈະເຮັດອາຊີບໃດແນ່ ອາຊີບກໍ່ແມ່ນ, ບໍລິສັດກໍ່ແມ່ນ\r\n2. ເປັນການວາງເປົ້າໝາຍສູ່ການເຕີບໂຕໃນອາຊີບ ເມື່ອເຮົາພົບຕົນເອງແລ້ວວ່າ ອາຊີນີ້ແມ່ນເລີຍ ແລ້ວອົງກອນກໍ່ແມ່ນ ເຮົາກໍ່ຕ້ອງເບິ່ງເຖິງອະນາຄົດຍາວໆແລ້ວວ່າ 1 ປີຜ່ານໄປ 2ປີຜ່ານ 3ປີຜ່ານ 5ປີ 10 ປີຜ່ານໄປ ເຮົາຈະເດີນທາງໃນເສັ້ນທາງນີ້ແນວໃດ\r\n3. ການພັດທະນາຕົນເອງ ແລະ ສ້າງຜົນງານໃຫ້ໄດ້ ການທີ່ເຮົາເຂົ້າເຮັດວຽກໃໝ່ໆ ອາລົມທີ່ວ່າ ດາວຮຸ່ງ ພຸ່ງແຮງຈະຕ້ອງທຳໃຫ້ເກີດໃຫ້ໄດ້ \r\nດາວຮຸ່ງພຸ່ງແຮງໝາຍຄວາມວ່າ ເຮົາເປັນນ້ອງໃໝ່ທີ່ໄຟແຮງ ມີຄວາມສາມາດໃນການຮັບຜິດຊອບເນື້ອງານ ແລະ ກໍ່ສ້າງຜົນງານໄດ້ດັ່ງໃຈດ້ວຍເຊັ່ນ: ເອົາຄວາມຮູ້ທີ່ໄດ້ຮຽນຮູ້ໃນຫຼັກສູດຕ່າງໆມາປະສົມກັບການຮຽນຮູ້ສິ່ງໃໝ່ໆ ຕໍ່ຄວາມຮັບຜິດຊອບຂອງເຮົາຈົນເຂົາເອີ້ນວ່າ: ເຮົາເປັນນ້ອງໃໝ່ທີ່ໄຟແຮງ', 0, '2024-01-20 15:27:39'),
(13, 'ວີດີໂອທີ່3: 4 ຂັ້ນຕອນ ການຈັດຄວາມຄິດລົບ\r\nຂັ້ນຕອນທີ່1. ເຮົາຕ້ອງຮູ້ຈັກການໃຊ້ເຄື່ອງໃນການກວດວັກອາລົມຄວາມຮູ້ສຶກຄວາມຄິດລົບຂອງເຮົາ ຄື: ການກວດຈັດອາລົມຄວາມຮູ້ສຶກຂອງເຮົາ ເມື່ອເຮົາຮູ້ສຶກວ່າເມື່ອຍໆ ສະແດງວ່າກຳລັງຄິດລົບແລ້ວ\r\nຂັ້ນຕອນທີ່2: ການປັບມຸງມອງຄວາມຄິດຊ່ວຍເຕີມພະລັງໃຫ້ເຮົາຄິດຈາກລົບກາຍເປັນບວກໃຫ້ກັບເຮົາໄດ້ ໃຫ້ເນັ້ນໃສ່ແງ່ດີໂດຍປາສະຈາກແງ່ຮ້າຍເຊັ່ນ: ສົມມຸດເຮົາເນັ້ນໃສ່ບັນຫາວ່າເປັນຫຍັງມີແຕ່ບັນຫາເຮັດໃຫ້ເຮົາເມື່ອຍ ແຕ່ຄັນເຮົາເບິ່ງໄປໃນແງ່ດີວ່າບັນຫາເຫຼົ່ານີ້ຕ້ອງມີວິທີແກ້ເຮັດໃຫ້ເຮົາມີພະລັງເພີ່ມຂື້ນ\r\nຂັ້ນຕອນທີ່3: ການປັບປ່ຽນຕົວເອງໃຫ້ເປັນຄົນເຊິງຮຸກ ເຊິງຮຸກໝາຍເຖິງວ່າເປັນການເດີນເຂົ້າຫາບໍ່ແມ່ນຄົນນັ່ງລໍຄອຍໃຫ້ທຸກຢ່າງນັ້ນເປັນໄປ ບໍ່ແມ່ນໂຍນທຸກຢ່າງໃຫ້ຄົນອື່ນຮັບຜິດຊອບ ແຕ່ເຮົາເປັນຄົນທີ່ເລີ່ມຮັບຜິດຊອບໃນສິ່ງທີ່ກ່ຽວຂ້ອງກັບບົດບາດຂອງເຮົາເອງ ເປັນຄົນຄິດເອງເຮັດເອງ ບໍ່ແມ່ນລໍແຕ່ຄົນອື່ນເຮັດ\r\nຂັ້ນຕອນທີ່4: ການຫາສິ່ງແວດລ້ອມທີ່ເສີມພະລັງບວກໃຫ້ກັບເຮົາ ໃນໂລກນີ້ສິ່ງແວດລ້ອມທີ່ເຮົາຢູ່ກັບເປັນແຕ່ສິ່ງແວດລ້ອມທີ່ເຕີມພະລັງໃນສິ່ງລົບໃຫ້ເຮົາເທົ່ານັ້ນບໍ່ວ່າແມ່ນ ທີວີ ເຟສບຸກ ໜັງສືພິມ ມີແຕ່ເລື່ອງລົບໆຮ້າຍໆ ເຮົາຕ້ອງຫາສິ່ງແວດລ້ອມໃຫ້ເໝາະສົມເຊັ່ນ 5ຄົນທີ່ໃກ້ສິດ, 5ເຫຼັ້ມໜັງສື, 5 ຊ່ອງຢູທູບ, ', 0, '2024-01-20 16:31:04'),
(14, 'ວີດີໂອທີ່4: 4ວິໄນສູ່ອິດສະຫຼະພາບ\r\n# ອິດສະຫຼະພາບເລຶ່ອງເວລາ ແລະ ໝົດຫ່ວງເລື່ອງການເງິນ\r\n- ວິໄນ ແລະ ຄວາມຮັບຜິດຊອບ\r\n1. ວິໃນການດູແລສຸຂະພາບຂອງຕົນເອງ ທັ້ງໃນເລື່ອງຂອງສຸຂະພາບກາຍ ແລະ ໃຈ (Mind and Body are One)\r\n2. ວິໃນການພັດທະນາຕົນເອງໃຫ້ມີຄວາມຮູ້ຄວາມສາມາດໃຫ້ຫຼາຍຂື້ນ( ການພັດທະນາຕົນເອງຢ່າງຕໍ່ເນື່ອງໃຫ້ທັນກັບການຕະຫຼາດຍ້ອນມັນປ່ຽນໄວຫຼາຍ)\r\n3. ການລົງມືເຮັດໃນສິ່ງທີ່ຕ້ອງເັຮດໃຫ້ໄດ້ (ການປ່ຽນຕົນເອງໃຫ້ມີຄຳວ່າ ຕ້ອງຫຼາຍກວ່າມັກ)\r\n4. ການເຮັດວຽກນຳຄົນອື່ນໄດ້\r\nວິໃນເຫຼົ່ານີ້ຕອນທຳອິດເຮົາອາດຈະມີຄວາມຮູ້ສຶກອືດອັດໃຈໃນເວລາເຮົາສ້າງວິໄນ ເພາະເປັນສິ່ງທີ່ເຮົາຕ້ອງໃຊ້ການຄວບຄຸມຕົນເອງຢູ່ຕະຫຼອດເວລາແຕ່ຫຼັງຈາກເຮົາຄວບຄຸມຕົນເອງໄປໄລຍະໜຶ່ງ ມັນຈະມີສິ່ງມາແທນທີ່ ທີ່ເຮົາເອີ້ນວ່າ ນິດໄສ\r\nວິໄນຈະສ້າງ ນິດໄສ, ນິດໄສຈະສ້າງຊີວິດໃໝ່', 0, '2024-01-20 17:04:48'),
(16, 'ປະຕິບັດຕາມກົດ:\r\n- ກວດຫ້ອງທຸກໆເຊົ້າກ່ອນກິນເຂົ້າ\r\n- ປະຕິບັດຕາມຕາຕະລາງຂອງທ່ານ\r\n-ໂທລະສັບຂອງທ່ານແບັກເຕີຣີຕ້ອງບໍ່ຕຳ່ກວ່າ 30 %\r\n# ຖ້າຫາກທ່ານໃດບໍ່ປະຕິບັດຕາມກົດໂດຍທີ່ບໍ່ມີເຫດຜົນຈະຖືກປັບໝາຍຄັ້ງລະ 20000ກີບຕັ້ງແຕ່ວັນທີ່ 21/01/2024 ເປັນຕົ້ນໄປ', 0, '2024-01-21 07:08:12'),
(18, 'ເປັນຄົນດີຕັ້ງແຕ່ມື້ນີ້ເປັນຕົ້ນໄປຈົນຮອດມື້ມີຄົນມາສູ້ນຳກັນ ແລະ ແຕ່ງງານ', 0, '2024-01-21 16:26:58'),
(21, 'Studying Lesson 1 First Day \r\n学 习  xue xi  study\r\n到 语 dao yu introduction\r\n你 好 \r\n你 们 好\r\n老 师 好\r\n大 家 好\r\n看 一 看 kan yi kan   watch the dialogue\r\n老 师 好！\r\n你 好\r\n对 不 起, dui bu qi\r\n我 不 知道 我 的 教室 在 那人 wo bu zhidao wo de jiaoshi zai nar\r\n你 叫 什 么 名 子？ Ni jiao shen me ming zi?\r\n我叫 吗丁 wo jiao ma ding\r\n你 是 那 国 人？ni shi nar guo ren\r\n我 是 澳大利亚人  wo shi aodaliya ren\r\n你 的 教室 在 3 层，312  ni de jiaoshi zai san ceng, sanyao er\r\n谢谢\r\n学 一 学\r\n老师\r\n对 不 起 dui bu qi   sorry\r\n没 关 系  mei guan xi    it’s ok\r\n教室  jiaoshi  classroom\r\n在  zai   at, in\r\n那 na   where\r\n在 那\r\n名字\r\n国  guo country\r\n层 ceng  floor\r\n中 国 人  见 面 打 招呼 时， 一 般 常 用 “ 你 好 “ 。 如 果 临近 吃饭\r\n的 时间\r\n\r\n\r\n', 0, '2024-01-21 21:04:55'),
(22, 'ecommerce ຄວນຈະມີລະບົບ tracking ຫຼື ໃຫ້ຜູ້ຊື້ສາມາດຕິດຕາມຄວາມເຄື່ອນໄຫວ ຫຼື ຄວາມຄຶບໜ້າຂອງຄຳສັ່ງຊື້ເຂົາໄດ້\r\n- ການຄ້າເທິງເວັບຕ້ອງຢຶກຫຼັກການທີ່ວ່າ ສັນຍາຕ້ອງເປັນສັນຍາ\r\n- ຫຼັການໃນການຂຽນ Disclaimer: ກົດກະຕິກາມາລະຍາດ ແລະ ສິ່ງທີ່ເຮົາບໍ່ຮັບຜິດຊອບ ເພື່ອບໍ່ໃຫ້ເຂົາມາຮຽກຮ້ອງ ຫຼື ເອົາຜິດກັບເຮົາໄດ້\r\nweb ທີ່ໃຊ້ຈິງຄື: www.shoppingthai.com', 0, '2024-01-22 08:43:47'),
(23, '1. ຄຳຖາມຄື: ເວລາທີ່ລູກຄ້າສັ່ງຊື່ສຳເັລດເຮົາຄວນຈະຕ້ອງຕອບແຊັດຫາລູກຄ້າທາງຊ່ອງໃດດີກວ່າລະຫວ່າງ Email ແລະ WhatsApp\r\n2. ຄຳຖາມຄື: ວິທີເຮັດສັນຍາຄວນມີວິທີແນວໃດເພື່ອໃຫ້ຖືກຕ້ອງ ແລະ ສະດວກທາງສອງຝ່າຍ?', 0, '2024-01-22 08:50:11'),
