(30, 'ບົດທີ່1:\r\n1. ນິຍາມຂອງ ecommerce:  ໝາຍເຖິງການຄ້າທຸກປະເພດທີ່ດຳເນີນການໂດຍຜ່ານສື່ເອເລັກໂທຣນິກເຊັ່ນ: Internet, Fax, Telephone, TV Media, ໂທລະສັບ...\r\n2. ຮູບແບບຂອງ ecommerce ມີຢູ່ 3 ຮູບແບບຄື: B2B, B2C, C2C', 0, '2024-02-04 16:27:45'),
