(32, 'ພະນັກງານ 5 ປະເພດ:\r\n1 ໂງ່ ແລະ ຂິ້ຄ້ານ: ບໍ່ຄິດ, ບໍ່ອ່ານ, ບໍ່ປະກອບສ່ວນ...\r\n2 ສ້າງ: ໂງ່ ແຕ່ຂະຫຍັນ\r\n3 ສະຫຼາດ ແຕ່ຂີ້ຄ້ານ: ຄັດຂວາງ ແຕ່ບໍ່ລົງມືເຮັດ\r\n4 ຕິດດາວ: ສະຫຼາດ ແລະ ຂະຫຍັນ ວາງແຜນເອງ, ສ້າງເອງ, ວາງແຜນໃຫ້ຫົວໜ້າໃຫ້ເຮັດຕາມ, ນົກອິນຊີ, ດາວແດງ\r\n5: ສຸດງ່າໃດ ກິນງ່ານັ້ນ: ປັບຕົວໄວ', 0, '2024-02-06 22:25:31'),
(33, '1 ຄົນລະດັບລຸ່ມ ຄວາມສຳເລັດມີໜ້ອຍແຕ່ຈຳນວນຄົນມີຫຼາຍ \r\n2 ຄົນລະດັບກາງ ຄວາມສຳເລັດພໍດີກັບຈຳນວນຄົນ\r\n3 ຄົນລະດັບສູງ ຄວາມສຳເລັດມີຫຼາຍ, ຄຸນນະພາບຂອງຄວາມສຳເລັດມີຫຼາຍ ແຕ່ຄົນສຳເລັດມີໜ້ອຍ\r\nເບິ່ງລະດັບຄົນ', 0, '2024-02-06 22:35:01'),
(34, ' 7 ຫຼັກການການຕັ້ງລາຄາສິນຄ້າ:\r\n1. ອາພິນິຫານເລກ 9 ເຊັ່ນ: 99000ກີບ\r\n2. ສິນຄ້າລາຄາສູງ: ຫ້າມໃຊ້ເລກກົມເຊັ່ນ: 500000ກີບ, 1000000ກີບ ໃຫ້ໃຊ້ເລກເສດເຊັ່ນ: 499000ກີບ, 999000ກີບ\r\n3. ຍິ່ງສັ້ນຍິ່ງຖືກເຊັ່ນ: 99000.00ກີບ ແລະ 99000ກີບ\r\n4. ຕັ້ງລາຄາເປັນຊຸດເຊັ່ນ: ຊື້2ແຖມ1\r\n5. ບອກລາຄາທີ່ລຸດເປັນ % ເຊັ່ນ: 1000000ກີບ ຫຼຸດ 10 % ເປັນຫຼຸດ 100000ກີບ', 0, '2024-02-06 22:45:37'),
(35, '30 ຄຳຄົມແຮງບັນດານໃຈຄົນລະດັບໂລກ:\r\n1. ຖ້າເຈົ້າຢາກລວຍ ຫ້າມໃຫ້ຕົນເອງມີຂໍ້ອ້າງ (Robert mizaki)\r\n2. ເວລາຂອງເຈົ້າມີຈຳກັດ ເພາະສະນັ້ນ ຫ້າມເສຍເວລາໃຊ້ຊີວິດຕາມແບບຊີວິດຂອງຄົນອື່ນ steve job\r\n3. ເມື່ອເຈົ້າຂາຍຂອງຄົນທຳອິດທີ່ຈະເຊື່ອຖືຄືເຈົ້າຈະເປັນຄົນແປກໜ້າ ເພື່ອນຈະຕັ້ງກຳແພງໃສ່ເຈົ້າ ເພື່ອນກິນຈະຕີຕົວອອກຫ່າງ, ຄອບຄົວຈະເບິ່ງແຄຣນເຈົ້າ ແຕ່ວັນທີ່ເຈົ້າປະສົບຄວາມສຳເລັດ ເຈົ້າເປັນຄົນຈ່າຍໃນທຸກຄັ້ງທີ່ລວມຕົວກັນຫຼືສັງສານລືຄ່ຳແຕ່ເຈົ້າຈະພົບວ່າທຸກຄົນຈະປາກົດຕົວຍົກເວັ້ນຄົນແປກໜ້າ ( Jack Ma)\r\n4. ຄົນທີ່ມົ່ວໃຊ້ເວລາໄປກັບການຈັບຜິດຄົນອື່ນມັກຈະບໍ່ມີເວລາແກ້ໄຂຕົນເອງ ( Ar jonah)\r\n5. ບໍ່ວ່າເຈົ້າຈະມີພອນສະຫວັນ ຫຼື ມານະພະຍາຍາມເທົ່າໃດ ບາງຢ່າງກໍ່ຕ້ອງໃຊ້ເວລາ ເຈົ້າບໍ່ສາມາດຄອກລູກໄດ້ພາຍໃນເດືອນດຽວ ໂດຍໃຊ້ຄົນອຸ່ນທ້ອງ 9 ຄົນ ( Wonley ma fack)\r\n6. ເມື່ອເຈົ້າພົບວ່າຕົນເອງຕົກລົງໄປໃນຫຼຸມສິ່ງສຳຄັນທີ່ສຸດເຈົ້າຄວນເຮັດຄື ຫ້າມຂຸດຫຼຸມນັ້ນໃຫ້ເລິກກວ່າເກົ່າ ( Wonley ma fack)\r\n7. ຄົນທີ່ເບິ່ງໂລກໃນແງ່ຮ້າຍຈະເຫັນອຸປະສັກຢູ່ໃນທຸກໆໂອການ ສ່ວນຄົນເບິ່ງໂລກໃນແງ່ດີຈະເຫັນໂອກາດຢູ່ໃນທຸກໆອຸປະສັກ (Winstone churn) \r\n8. ເຈົ້າຕ້ອງເຊື່ອໃນສິ່ງທີ່ຢູ່ໃນໃຈຂອງເຈົ້າແລ້ວ ໃຊ້ສະໝອງໃນການຕັດສິນໃຈ （michel dobert)\r\n9. ຊີວິດຄົນເຮົານັ້ນແສນສັ້ນ ຫ້າມມົ່ວເສຍເວລາກັບຄົນບໍ່ເອົາຖ່ານ ( jaf feso)\r\n10. ເຄິ່ງໜຶ່ງຂອງຄວາມສະຫຼາດຄືການທີ່ເຈົ້າຮູ້ວ່າຕົນເອງໂງ່ເລື່ອງໃດ (david kero)', 0, '2024-02-06 23:17:08'),
(36, '11. ຖ້າເຈົ້າຍັງບໍ່ເລີກເປັນກົບໃນກະລາເຈົ້າຈະບໍ່ມີທາງຮູ້ເລີຍວ່າ ໂລກນີ້ກວ້າງໃຫຍ່ພຽງໃດ ( Anjolina joly)\r\n12. ຂ້ອຍມັກເລືອກຄົນຂີ້ຄ້ານມາເຮັດວຽກຍາກໆ ເພາະຄົນເຫຼົ່ານີ້ຈະຄິດວ່າ ຈະເຮັດແນວໃດໃຫ້ມັນງ່າຍ (Bill kate)\r\n13. ທ້າຍສຸດແລ້ວມັນບໍ່ສຳຄັນວາເຈົ້າມີຊີວິດຢູ່ຈັກປີ ສິ່ງສຳຄັນກວ່າຄື: ຕອນເຈົ້າມີຊີວິດຢູ່ເຈົ້າໃຊ້ມັນດີເທົ່າໃດ ( Araham bincon)\r\n14. ໃຊ້ຊີວິດດາວກັບວ່າເຈົ້າຈະເສຍຊີວິດມື້ອື່ນ ແຕ່ຈົ່ງຮຽນຮູ້ກັບວ່າ ເຈົ້າຈະມີຊີວິດຢູ່ຕະຫຼອດໄປ ( mahatama khanthee) \r\n15. ຄົນທີ່ລົ້ມເຫຼວຈະເໜືອນກັນຢູ່ຢ່າງໜຶ່ງຄຶ ພວກເຂົາທຸກຄົນມີແຕ່ຄຳເວົ້າວ່າເບິ່ງກ່ອນ ( Jack Ma)\r\n16. ທ້າຍທິດສຸດແລ້ວສິ່ງທີ່ຈະວັກຕົວເຈົ້ານັ້ນບໍ່ແມ່ນເຈົ້າທຳມາຫຼາຍເທົ່າໃດ ແຕ່ອັນໃດແດ່ທີ່ເຈົ້າເຮັດສຳເລັດຕາງຫາກ ( donuthrum) \r\n17. ມີຄົນຫຼາຍໃຊ້ເງິນທີ່ພວກເຂົາບໍ່ໄດ້ຫາເອງຊື້ສິ່ງທີ່ພວກເຂົາບໍ່ໄດ້ຕ້ອງການເພື່ອໄປອວດຄົນທີ່ພວກເຂົາບໍ່ມັກ ( wilsmith) \r\n18. ບໍ່ວ່າເຈົ້າຈະຄິດວ່າຕົນເອງເກັ່ງເທົ່າໃດ ເຈົ້າກໍ່ບໍ່ເກັ່ງພໍທີ່ຈະໄປດູຖູກໃຜກໍ່ໄດ້ 2（ paul walker)\r\n19. ຂ້ອຍບໍ່ໄດ້ລົ້ມເຫຼວ ຂ້ອຍພຽງແຕ່ພົບກັບ ໜຶ່ງໝື່ນວິທີທີ່ໃຊ້ງານບໍ່ໄດ້ ( Thomus adison)\r\n20. ເລີ່ມຕົ້ນດ້ວຍດີເທົ່າກັບສຳເລັດໄປແລ້ວເຄິ່ງໜຶ່ງ ( arithoter)', 0, '2024-02-06 23:42:01'),
(37, '21. ຢາກໃຫ້ໃຜເຮັດແນວໃດກັບເົຮາ ເຮົາຕ້ອງເຮັດແນວນັ້ນກັບເຂົາກ່ອນ ( Bradly duple)\r\n22. ການເຮັດວຽກເຮັດໃຫ້ເຈົ້າຮູ້ຄວາມໝາຍ ແລະ ໜ້າທີ່ ຖ້າບໍ່ມີງານຊີວິດກໍ່ວ່າງເປົ່າ (stevephen hin)\r\n23. ຫ້າມຕັດສິນສິ່ງທີ່ເຂົາເຄີຍເປັນມາກ່ອນປ່ອຍໃຫ້ເຂົາໄດ້ສະແດງຕົວຕົນແລ້ວ ເບິ່ງທີ່ປະຈຸບັນບໍ່ແມ່ນອາດີດ ( thomy tanstund)\r\n24. ຈະກັງວົນໄປເຮັດຫຍັງ ຖ້າເຈົ້າເຮັດດີທີ່ສຸດເທົ່າທີ່ຈະເຮັດໄດ້ແລ້ວ ຄວາມກັງວົນບໍ່ເຄີຍເຮັດໃຫ້ອັນໃດດີຂື້ນເລີຍ (Vondisny)\r\n25. ເຈົ້າບໍ່ມີທາງຢູ່ໃຫ້ 500 ລ້ານຄົນໄດ້ ໂດຍທີ່ບໍ່ມີໃຜບາງຄົນເປັນສັດຕູ (Mark zuckerberge)\r\n26. ຄົນມັກຄິດວ່າຂ້ອຍເຮັດບໍ່ໄດ້ແຕ່ຄົນລວຍຈະຄິດວ່າ ຈະເຮັດແນວໃດ ( Robert Mizaki)\r\n27. ຄົນທີ່ບໍ່ເຄີຍເຮັດຜິດຄືຄົນທີ່ບໍ່ເຄີຍເຮັດຫຍັງເລີຍ (Albert EIstyle)\r\n28. ການເຮັດໃຫ້ຕົນເອງຕ່າງຈາກຄົນອື່ນນັ້ນງ່າຍ ແຕ່ເຮັດໃຫ້ດີກວ່າຄົນອື່ນນັ້ນຍາກຍິ່ງກວ່າ ( Jonaran aif)\r\n29. ຄວາມສຳເລັດເບິ່ງເໝືອນວ່າຈະເສື່ອມຕໍ່ກັບການກະທຳ ຄົນທີ່ປະສົບຄວາມສຳເລັດເຂົາໄປຕໍ່ແມ້ພວກເຂົາເຮັດຜິດພາດ ແຕ່ພວກເຂົາກໍ່ບໍ່ຍອມແພ້ ( conrad histon)\r\n30. ຊີວິດໄວຮຽນ ແລະ ຊີວິດຈິງແຕກຕ່າງກັນທີ່ຊີວິດໄວຮຽນ ເຮົາໄດ້ຮັບການສອນບົດຮຽນກ່ອນເຮັດແບບທົດສອບ ແຕ່ໃນຊີວິດຈິງນັ້ນ ເົຮາຈະໄດ້ເຮັດແບບທົດສອບທີ່ຈະສອນບົດຮຽນໃຫ້ກັບເຮົາ (Tom modet)', 0, '2024-02-07 00:07:16'),
