(42, 'ເງິນບໍ່ພໍໃຊ້ແກ້ແບບນີ້ ປ່ຽນທັກສະການຫາເງິນ: ປ່ຽນຄວາມຄິດເຊັ່ນ: ທັກສະການຂາຍ', 0, '2024-02-07 01:06:48'),
(43, 'ສາເຫດທີ່ຄົນຢ້ານໃນການເວົ້າ:\r\n1. ບໍ່ຮູ້ໃນສິ່ງທີ່ຈະເວົ້າ\r\n2. ບໍ່ຮູ້ວິທີເວົ້າ\r\n3. ຄິດລົບ ຢ້ານເວົ້າໄປແລ້ວມັນຜິດພຸ້ນ ຜິດພີ້\r\nວິທີແກ້ຄື: \r\n1. ກ່ອນຈະເວົ້າເລື່ອໃດ ໃຫ້ເຈົ້າເຂົ້າໃຈເລື່ອງນັ້ນ\r\n2. ຮຽນຮູ້ວິທີເວົ້າຈາກຜູ້ທີ່ມີປະສົບການ\r\n3. ປ່ຽນຊຸດຄວາມຄິດລົບມາເປັນຊຸດຄວາມຄິດບວກ', 0, '2024-02-07 01:18:44'),
