(46, 'ແມ່ນຫຍັງເຮັດໃຫ້ສອງຄົນມີຊີວິດທີ່ແຕກຕ່າງກັນ:\r\n1.1 ເລີ່ມຈາກສິ່ງນ້ອຍໆຕົ້ນທຶນຄື ໄອເດຍ ເຮັດແບບບໍ່ໃຊ້ເງິນຫຼືໃຊ້ເງິນຄົນອື່ນ\r\n2.1 ຕົ້ນທຶນຂອງຄົນເຮົາບໍ່ເທົ່າກັນບໍ່ມີທືນເພາະເກີດມາຈົນຈື່ງເຮັດຫຍັງບໍ່ໄດ້\r\n1.2 ຮຽນເພື່ອເອົາຄວາມຮູ້ໄປສ້າງທຸລະກິດ\r\n2.2 ຮຽນເພື່ອເອົາວຸດທິໄປສະໝັກງານ\r\n1.3 ຊີວິດຂອງເຮົາຂື້ນຢູ່ກັບຕົວເອງ\r\n2.3 ຊີວິດຂອງເຮົາຂື້ນຢູ່ກັບຄົນອື່ນ\r\n1.4  ປ່ຽນຕົວເອງເພື່ອຊີວິດໃໝ່ທີ່ດີກວ່າເກົ່າ\r\n2.4 ບໍ່ປ່ຽນຕົວເອງເພື່ອຮັກສາຮູບແບບຊີວິດເກົ່າໆເອົາໄວ້\r\n1.5 ພັດທະນາຕົວເອງເພື່ອຂະຫຍາຍທຸລະກິດ (ເພີ່ມສັກກະຍາພາບ)\r\n2.5 ພັດທະນາຕົວເອງເພື່ອເງິນເດືອນເພີ່ມ (ເພີ່ມວຸດທິ)\r\n1.6 ສ້າງໜີ້ເພື່ອສ້າງທຸລະກິດ (ສ້າງລາຍໄດ້)\r\n2.6 ສ້າງໜີ້ເພື່ອບໍລິໂພກ (ສ້າງລາຍຈ່າຍ)\r\n1.7 ໂຟກັສທີ່ໂອກາດມີເຫດຜົນສຳລັບກ້າວໄປຂ້າງໜ້າ\r\n2.7 ໂຟກັສທີ່ອຸປະສັກມີເຫດຜົນສຳລັບການຢູ່ທີ່ເກົ່າ\r\n1.8 ເປັນຜູ້ນຳໝັ້ນໃຈຕົວເອງມີຄວາມຄິດສ້າງສັນຄິດນອກກອບ\r\n2.8 ເປັນຜູ້ຕາມບໍ່ໝັ້ນໃຈໃນຕົວເອງ ຖ້າຟັງຄຳສັ່ງຢູ່ໃນກອບ\r\n1.9 ມີຊີວິອິດສະຫຼະ ມີເວລາໄປຮຽນຮູ້ສິ່ງໃໝ່ໆ\r\n2.9 ບໍ່ມີອິດສະຫຼະ ເວລາສ່ວນໃຫຍ່ເຮັດແຕ່ງານ\r\n1.10 ຮັບຜິດຊອບທຸລະກິດທັງລະບົບງານໜັກບໍ່ຢ້ານ\r\n2.10 ຮັບຜິດຊອບພຽງໜ້າທີ່ຕົວເອງບໍ່ມັກງານໜັກ\r\n1.11 ບໍ່ອົດທົນກັບຮູບແບບຊີວິດທີ່ບໍ່ຕ້ອງການ\r\n2.11 ອົດທົນສູງຮັບຮູບແບບຊີວິດທີ່ບໍ່ຕ້ອງການ\r\n1.12 ຄິດໃຫຍ່ ຕ້ອງລວຍເທົ່ານັ້ນຊີວິດຕ້ອງດີຂື້ນ\r\n2.12 ຄິດນ້ອຍພຽງຢູ່ໄດ້ກໍ່ພໍບໍ່ລວຍກໍ່ໄດ້\r\n1.13 ເຊື່ອວ່າສຳເລັດໄດ້ເຖິງຈະບໍ່ພ້ອມ ແລະ ເຊື່ອວ່າຄົນເຮົາພັດທະນາໃຫ້ເກັ່ງໄດ້\r\n2.13 ເຊື່ອວ່າຈະສຳເລັດຕ້ອງພ້ອມ ແລະ ເກັ່ງເບິ່ງຕົວເອງວ່າບໍ່ເກັ່ງ ແລະ ພັດທະນາບໍ່ໄດ້\r\n1.14 ມັກໃຊ້ເວລາວ່າງຫາຄວາມຮູ້ໃໝ່ໆເພື່ອພັດທະນາທຸລະກິດ\r\n2.14 ມັກໃຊ້ເວລາວ່າງພັກຜ່ອນ ສ່າງສັນ ຫຼື ຄວາມບັນເທິງ\r\n1.15 ຕ້ອງສຳເລັດເທົ່ານັ້ນ ແລະ ກ້າລົງມືເຮັດບໍ່ຢ້ານຜິດພາດ (ເຮັດຜິດກໍ່ແກ້ໄຂ)\r\n2.15 ຢາກສຳເລັດແຕ່ບໍ່ກ້າເຮັດຫຍັງ ເພາະຢ້ານຜິດພາດ (ເຮັດຜິດກໍ່ແກ້ໂຕ)\r\n1.16 ຮູ້ວ່າແຕ່ລະວັນຕ້ອງເຮັດຫຍັງແນ່ ແລະ ແລ້ວເມື່ອໃດ\r\n2.16 ບໍ່ມີແຜນວ່າໃນແຕ່ລະວັນຕ້ອງເຮັດຫຍັງແນ່\r\n1.17 ເຮັດສິ່ງທີ່ຮັກ ມີຄວາມສຸກກັບວຽກ ແຕ່ລະວັນຜ່ານໄປຢ່າງວ່ອງໄວ\r\n2.17 ເຮັດສິ່ງທີ່ໄດ້ເງິນ ຕ້ອງອົດທົນເຮັດວຽກເວລາແຕ່ລະຊົ່ວໂມງຜ່ານໄປຢ່າງຊ້າໆ\r\n1.18 ໃຊ້ຄວາມຄິດເພື່ອສ້າງຖານະເປັນສ່ວນໃຫຍ່\r\n2.18 ໃຊ້ຄວາມຄິດກັບການເຮັດວຽກເປັນສ່ວນໃຫຍ່\r\n1.19 ມັກພັດທະນາຕົວເອງ ແລະ ຮຽນຮູ້ສິ່ງໃໝ່ໆຢູ່ຕະຫຫຼອດເວລາ ເພື່ອພັດທະນາທຸລະກິດ\r\n2.19 ຈະພັດທະນາຕົວເອງ ແລະ ຮຽນຮູ້ສິ່ງໃໝ່ໆເທົ່າທີ່ຈຳເປັນເພື່ອຮັກສາຕຳແໜ່ງ\r\n1.20 ໄດ້ຮັບລາງວັນເປັນຄຸນນະພາບຊີວິດທີ່ເຮົາຕ້ອງການ\r\n2.20 ໄດ້ຮັບລາງວັນເປັນໃບປະກາດໂລ່ ແລະ ຄຳຊົມ\r\n1.21 ເປົ້າໝາຍຊັດເຈນ ສາມາດລະບຸໄດ້ແບບເຈາະຈົງ\r\n2.21 ເປົ້າໝາຍກວ້າງເລື່ອນລອຍ ບໍ່ຊັດເຈນບໍ່ເຈາະຈົງ\r\n1.22 ເປັນເຄື່ອງປັ່ນໄຟ ປັ່ນໄຟໃຊ້ເອງ ມີແຮງບັນດານໃຈຢ່າງຕໍ່ເນື່ອງ\r\n2.22 ເປັນແບັດເຕີຣີ້ ເມື່ອແບັດໝົດຕ້ອງໄປສາກ (ໃຫ້ຄົນອື່ນເປັນແຮງຈູງໃຈ)\r\n1.23 ປະຢັດ ຊື້ແຕ່ຂອງຈຳເປັນ ແລະ ໃຊ້ຢ່າງຮູ້ຄ່າ\r\n2.23 ຟຸ່ມເຟື່ອຍ ຊື້ຂອງທີ່ບໍ່ຈຳເປັນໄປວາງຖີ້ມ ບໍ່ໄດ້ໃຊ້\r\n1.24 ຫາທີ່ປຶກສາທີ່ຮູ້ແທ້ ຊ່ຽວຊານ ຊ່ວຍຄິດ\r\n2.24 ຂໍຄຳປຶກສາຈາກຄົນໃກ້ຕົວ ອາດຈະບໍ່ຊ່ຽວຊານ\r\n1.25 ມີວິໄສທັດພ້ອມທີ່ຈະເມື່ອຍ ແລະ ກ້າທີ່ຈະລົງທືນເພື່ອອານາຄົດ\r\n2.25 ບໍ່ມີວິໄສທັດບໍ່ຍອມເມື່ອຍ ແລະ ບໍ່ກ້າລົງທືນເພື່ອອານາຄົດ', 0, '2024-02-14 15:58:34'),
(47, 'blockchain', 0, '2024-02-19 20:01:57');
